import React from 'react';

class Home extends React.Component {
    constructor(props) {
        super(props);
    }

    componentDidMount() {
        const headers = { 'Content-Type' : 'application/json' };

        fetch("http://localhost:3001/", {
            method: 'GET',
            mode: 'cors',
            headers
        })
        .then((result) => {
            let errorMessage = 'No Error';

            if (result.status === 200) {
                result = result.json()
                    .then((result) => {
                        this.setState({
                            bookData: result
                        })
                    })
            }
        })
    }

    render() {
        return (
            <div>
                Home Placeholder Text
            </div>
        );
    }
}

export default Home;
